css:
.git-plus .alert {
  color: #df8008;
}
.git-plus .success {
  color: #18e000;
}
.git-plus .overlay.from-bottom {
  width: 600px;
}
.git-plus .info-view {
  overflow: auto;
}
.meta.diff.range.unified {
  color: #0058df;
}
.meta.diff.header {
  color: #0058df;
}
.markup.deleted.diff {
  color: #7f2b26;
}
.markup.inserted.diff {
  color: #18e000;
}
